With Spring Data Rest it is already very convenient to create a REST API to persist data by just specifying the data model using entities like this one: @Entity
public class Country { public long id; public String name; public int population; @OneToMany(mappedBy = "country") public List<City> cities;
} You just need to specify matching repositories, and Spring Data Rest will provide you with a HATEOAS API that supports all CRUD operations: public interface CountryRepository extends JpaRepository<Country, Long> {} If you want to e.g. create a new country from within a web application, you can now use the following code: const counrty = await fetch("http://example.com/countries", { method: "POST", body: { name: "Germany", population: 80_000_000, cities: [] }
}); However, creating REST requests that conform to the HATEOAS that Spring expects can be quite cumbersome. This is how you would add a city to a country: fetch("http://example.com/cities", { method: "POST", body: { name: "Dortmund", population: 600_000, counrty: counrty._links.self.href }
}) Although HATEOAS is not overly complicated, it is easy to make a mistake e.g. by misspelling the URL or a property name, using the wrong method or supplying an object as a related entity instead of a link. Also, if you change your API later on, you will have to manually check for all the places in your frontend where you have used it. This is where FeGen comes into play. You can add it to your Spring Boot project, and it will look at the entities and repositories you defined and generate frontend code in Typescript or Kotlin so you can access your API without worrying about the HATEOAS details: const country = await apiClient.countryClient.create({ name: "germany", population: 80_000_000, cities: []
}); apiClient.cityClient.create({ name: "Dortmund", population: 600_000, country
}); As you can see, this has multiple advantages: You do not need to know how HATEOAS works Generated types for entities prevent mistakes and give you auto completion When you change your API, obsolete usages in your frontend will cause compiler errors, so you can easily spot and fix them The code is more readable as it better conveys its intent Less boilerplate code As with Spring and Spring Data REST, with FeGen, you are not constrained to simple CRUD operations. You can use paging, sorting, custom searches and projections to access your data. Moreover, FeGen also generates code to access the methods within controllers.

