An example entity in Java may look like this: import javax.persistence.Column;
import javax.persistence.Entity;
import javax.persistence.GeneratedValue;
import javax.persistence.Id; import org.springframework.data.rest.core.config.Projection;
import org.springframework.lang.Nullable; @Entity
public class SomeEntity { @Id @GeneratedValue public long id; @Column(nullable = false) public String nonNullableField; @Nullable public String nullableField; private long value; public long getValue() { return value; } public void setValue(long value) { this.value = value; } private boolean b; public boolean isB() { return b; } public void setB(boolean b) { this.b = b; } @Projection(name = "baseProjection", types = {SomeEntity.class}) interface BaseProjection { long getId(); String getNonNullableField(); String getNullableField(); long getValue(); boolean isB(); }
} As you can see, there are two options of defining entity columns. You can either just use a single field or specify a getter for your field (like it was done for the value and b columns). Since Spring and FeGen can conclude from the name and signature of the function that getValue is a getter for value, only one column named value is created. If you wanted to annotate the value or b column, you could do so on the getter or the field. Since the value and b columns have primitive types, you do not need to specify their nullability.

