The entity from the Java example may look like this if written in Kotlin: import javax.persistence.Column;
import javax.persistence.Entity;
import javax.persistence.GeneratedValue;
import javax.persistence.Id;
import org.springframework.lang.Nullable; @Entity
class SomeEntity { @Id @GeneratedValue var id: Long = -1 @Column(nullable = false) lateinit var nonNullableField: String @Nullable var nullableField: String? = null var value: Long = 0 var b: Boolean = false @Projection(name = "baseProjection", types = [SomeEntity::class]) interface BaseProjection { val id: Long val firstName: String val lastName: String val number: String? }
} In Kotlin, it is best to define columns using the var keyword. If the type of your column is primitive, you need to initialize it like it is the case with id and value. Otherwise, you can use the lateinit modifier to avoid having to initialize a property that will often be overwritten by the contents of the database anyway. You still have to specify nullability for non-primitive properties, even though Kotlin has a notion of nullability in its types, because Spring will ignore them. For the base projection you can just use vals as they will be recognized by Spring in the same way as getters are.

