To create the actual website for your application, first create a directory for your frontend within the todo-app directory: mkdir frontend Usually when you create a web application using typescript, you will rely on some sort of framework like React or Angular. These usually come with a way to quickly get started and setup up your project. Since I do not want to presume knowledge of any specific framework, we will use plain HTML and Typescript in this guide and manually set up the typescript compilation and bundling process. Initialize this directory as an npm project by creating a package.json with the following content: { "name": "frontend", "devDependencies": { "@rollup/plugin-commonjs": "^17.0.0", "@rollup/plugin-node-resolve": "^11.1.0", "@rollup/plugin-typescript": "^8.2.1", "npm-run-all": "^4.1.5", "rollup": "^2.36.2", "serve": "^11.3.2", "tslib": "^2.1.0", "typescript": "^4.2.3" }, "dependencies": {}, "scripts": { "build": "rollup -c", "watch": "rollup -c -w", "dev": "npm-run-all --parallel start watch", "start": "serve public" }
} Your frontend project will use rollup to collect your sources and dependencies and compile everything to a single file. The development dependency serve will then be used as a simple HTTP server to deliver your website. Make sure you have Node.js installed and run the following to install the dependencies declared in the package.json: npm install We still need to tell rollup how it is supposed to find and compile our source code. Create a rollup.config.js in the frontend directory and add the following content: import resolve from '@rollup/plugin-node-resolve';
import commonjs from '@rollup/plugin-commonjs';
import typescript from "@rollup/plugin-typescript"; export default { input: 'src/main.ts', output: { file: 'public/bundle.js', format: 'iife', // immediately-invoked function expression â suitable for <script> tags sourcemap: true }, plugins: [ resolve(), // resolve dependencies (such as fegen-runtime) in node_modules commonjs(), // converts commonjs dependencies to ES modules typescript() // compile typescrip to javascript ]
}; This file tells rollup that it needs to compile the file frontend/src/main.ts. Create that file and the enclosing directory, and give it the following content: alert("Hello frontend"); The rollup configuration file also specifies that the output javascript should be written to frontend/public/bundle.js. Create the public directory and an index.html file within and add the following content to it: <!DOCTYPE html>
