<div id="todoItems"> </div>
</body>
</html> This is the base for your todo application. You can see a <script> tag to import the compiled javascript file and a <div id="todoItems"> tag where you will add your todo items once you have created your backend. Run the following command to instruct rollup to compile your typescript file to bundle.js: npm run dev Your index.html will also be served at http://localhost:5000 by this command, so you should see a dialog box reading "Hello frontend" when you open that address in your browser. Your typescript code will also be recompiled each time you change it. The steps for creating the frontend up until now were not specific to FeGen and will probably be simpler once you decide for a frontend framework. However, there are two steps that you will need to perform in order for FeGen to work in the frontend.
